import React from "react";

const User = props => {
  let age = props.age ? props.age : "N/A";
  if (props.childern) {
    return (
      <div>
        Name:{props.children} | Age: {age}
      </div>
    );
  } else {
    return <div>Invalid Entry</div>;
  }
};

export default User;
